<div>
    <h4>Mancha Aureolada</h4>
    <p>A mancha aureolada é uma doença que tem se destacado na cafeicultura brasileira nos últimos anos. Ela é causada pela bactéria Pseudomonas syringae pv. Garcae e foi constatada pela primeira vez em 1955, na região de Garça, no Estado de São Paulo.

     </p><p>Tal enfermidade era mais comum nas regiões cafeeiras mais frias, como os estados do Paraná e São Paulo, porém, nos últimos anos tem-se constatado também nas zonas cafeeiras do Cerrado Mineiro (Triângulo e Alto Paranaíba), Sul de Minas e áreas de elevada altitude das Matas de Minas. Tem maior severidade, em sua maioria, em lavouras novas, com até 4 anos, mas lavouras velhas que foram podadas e viveiros de mudas podem ser altamente vulneráveis.
    </p>
    ");
